import axios from "axios";

export const users = axios.get('https://65d8e520c96fbb24c1bc7907.mockapi.io/api/test/users')
    .then(function (response) {
    // handle success
    console.log(response);
  })
  .catch(function (error) {
    // handle error
    console.log(error);
  })
  .finally(function () {
    // always executed
  });;
